INSERT INTO `quotes` VALUES (1,'The only bad workout is the one that didn\'t happen. - Unknown'),(2,'Exercise not only changes your body, it changes your mind, your attitude, and your mood. - Unknown'),(3,'Fitness is not about being better than someone else. It’s about being better than you used to be. - Khloe Kardashian'),(4,'The body achieves what the mind believes. - Napoleon Hill'),(5,'Your body can stand almost anything. It’s your mind that you have to convince. - Unknown'),(6,'Don’t limit your challenges, challenge your limits. - Jerry Dunn'),(7,'Take care of your body. It’s the only place you have to live. - Jim Rohn'),(8,'The pain you feel today will be the strength you feel tomorrow. - Unknown'),(9,'Sweat is fat crying. - Jillian Michaels'),(10,'Exercise is a celebration of what your body can do. Not a punishment for what you ate. - Unknown'),(11,'Success isn’t always about greatness. It’s about consistency. Consistent hard work gains success. Greatness will come. - Dwayne \"The Rock\" Johnson'),(12,'Train insane or remain the same. - Unknown'),(13,'The only way to finish is to start. - Unknown'),(14,'What seems impossible today will one day become your warm-up. - Unknown'),(15,'The difference between the impossible and the possible lies in a person’s determination. - Tommy Lasorda'),(16,'Push yourself because no one else is going to do it for you. - Unknown'),(17,'The pain of today is the victory of tomorrow. - Unknown'),(18,'The harder the battle, the sweeter the victory. - Les Brown'),(19,'You don’t have to be extreme, just consistent. - Unknown'),(20,'Don’t stop when you’re tired. Stop when you’re done. - Marilyn Monroe'),(21,'물고기는 헤엄치고 새는 날고 인간은 달린다 - 구현우'),(22,'우사인 볼트가 세계에서 왜 제일 달리가 빠른 사람인줄 알아요? 끝까지 갔기 때문이예요 - 스윙스');
/*!40000 ALTER TABLE `quotes` ENABLE KEYS */;
UNLOCK TABLES;

